import React, { Component } from 'react';

class Navbar extends Component {
    render() {
        return (
            <div>
                <nav className="navbar navbar-expand-lg navbar-dark ftco_navbar bg-dark ftco-navbar-light" id="ftco-navbar">
                    <div className="container-fluid">

                    <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#ftco-nav" aria-controls="ftco-nav" aria-expanded="false" aria-label="Toggle navigation">
                        <span className="fa fa-bars"></span> Menu
                    </button>
                    <div className="collapse navbar-collapse" id="ftco-nav">
                        <ul className="navbar-nav m-auto">
                            <li className="nav-item active"><a href="index.html" className="nav-link">Accueil</a></li>
                            <li className="nav-item"><a href="about.html" className="nav-link">Candidat</a></li>
                            <li className="nav-item"><a href="coming-soon.html" className="nav-link">Employeur</a></li>
                            <li className="nav-item"><a href="top-seller.html" className="nav-link">Espace Client</a></li>
                            <li className="nav-item"><a href="book.html" className="nav-link">Contact</a></li>
                        </ul>
                    </div>
                    </div>
                </nav>
            </div>
        );
    }
}

export default Navbar;
